import React from 'react';
import { NavLink } from 'react-router-dom';

function Navbar({ user }) {
  let beautiful = "";
  let parts = user.username.split("");
  for(let part of parts)
  {
    beautiful += "<small>"+part;
  }
  beautiful += "</small>".repeat(parts.length);
  return (
    <>
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <div className="container-fluid">
          <NavLink className="navbar-brand" to="/">Navbar</NavLink>
          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <NavLink className="nav-link active" aria-current="page" to="/">Home</NavLink>
              </li>
              <li className="nav-item">
                <a className="nav-link" href="/">Link</a>
              </li>
              <li className="nav-item">
                <a className="nav-link disabled" href="/" tabIndex="-1" aria-disabled="true">Disabled</a>
              </li>
            </ul>
            <form className="d-flex">
              <h1 dangerouslySetInnerHTML={beautiful}>
              </h1>
              {user ?
                <NavLink className="btn btn-success" type="submit" to="/logout" >Logout</NavLink> :
                <NavLink className="btn btn-success" type="submit" to="/login" >Login</NavLink>}
            </form>
          </div>
        </div>
      </nav>
    </>
  );
}

export default Navbar;
